import React from 'react';
export default function Practice() {

  const [count, setCount] = React.useState(0);
  function increment() {
    setCount(prev => prev++);
  }

  function decrement() {
    setCount(prev => prev--);
  }
  return (
    <div className='container' style={{ display: 'flex', gap: '20px', justifyContent: 'center', alignItems: 'center'}}>
        <div style={{ background: 'grey', width: '30px', height: '30px', borderRadius: '100px', display: 'flex', justifyContent: 'center', alignItems: 'center', color: 'white', fontWeight: 'bold', position: 'absolute', left: '330px', bottom: '650px'}} onClick={ decrement }>-</div>
        <div style={{ background: 'white', width: '100px', display: 'flex', justifyContent: 'center', alignItems: 'center', color: 'black', borderRadius: '100px', height: '80px', width: '80px', fontWeight: 'bold', fontSize: '20px'}}>{ count }</div>
        <div style={{ background: 'grey', width: '30px', height: '30px', borderRadius: '100px', display: 'flex', justifyContent: 'center', alignItems: 'center', color: 'white', fontWeight: 'bold', position: 'absolute', right: '330px', bottom: '650px'}} onclick={ increment }>+</div>
    </div>
  );
};
